INSERT INTO job (employer_id, field_id, city_id, post_date, title, description, salary, work_from_home)
VALUES (7, 2, NULL, '2021-02-03 02:36:54.480', 'Software Architect', 'Our company\'s is a global technology company that helps companies grow by successfully creating, customizing, implementing, and managing industry leading customer experience, CRM, and ERP software platforms to meet ever evolving business needs.  As a SugarCRM Elite partner and the 2020 Sugar Global Reseller of the Year, our company is also a leading partner with Sage, Zendesk, Salesforce, HubSpot, and a variety of other products.   We also build our own line of add-on products and offer custom software solutions.\n\nWork with our company and make a difference in real and measurable ways.  We believe in hard work, professionalism, personal & professional growth, and being the best at what we do.  Do you love software?   Our values support the belief that anything is possible, and we are looking to add members to the team who feel the same.  We invite you to explore exciting career opportunities with one of the leading software and professional service companies in the industry.'
        , '4000 - 7000 USD (mesečno)' , TRUE),
       (7, 2, 1, '2021-03-05 05:38:20.420', 'C++ Programmer', 'Our company is one of the leaders in entertainment, with a rich portfolio of well-known brands worldwide. We are committed to enriching players’ lives with original & memorable entertainment experiences. Our company Belgrade was established in 2016 and focuses on strengthening our company''s presence on multiple platforms – PC, console, and Google Stadia. Our studio has contributed to multiple AAA titles, including Tom Clancy’s Ghost Recon, Steep, The Crew 2, Tom Clancy’s Rainbow Six, Riders Republic and Skull & Bones.\n\nOur company is an equal opportunity employer that believes diverse backgrounds and perspectives are key to creating worlds where both players and teams can thrive and express themselves. If you are excited about solving game-changing challenges, cutting edge technologies and pushing the boundaries of entertainment, we invite you to join our journey and help us create the unknown.\n\nOur company in Belgrade is looking for a talented C++ Programmer to join our growing team! As a C++ Programmer, you will be responsible for the creation, debugging, maintenance and optimization of the game’s engine, editor and related tools that are used for the game’s development, in order to ensure a smooth production cycle for the entire development team. You will work closely together with the teams that are directly using this technology (Level Design, Game Design and Gameplay teams), in order to develop one of our major AAA titles.\n\nRESPONSIBILITIES\n\n- Participate to the project development on the engine, editor and tools programming side\n- Offer technical solutions, innovate and improve the quality of implementation, performance and usability of the editor, tools and tool chain as a whole\n- Communicate with the teams that use the technology in order to understand their requirements and to define the implementation and improvement needs\n- Keep the existing engine and tools up to date in accordance with the latest changes occurred in the development pipeline (e.g. new SDKs or middleware versions)'
       , NULL, FALSE),
       (7, 2, NULL, '2021-06-08 01:15:8.360', 'Senior C# Software Engineer', 'Are you curious, motivated, and forward-thinking? At FIS you’ll have the opportunity to work on some of the most challenging and relevant issues in financial services and technology. Our talented people empower us, and we believe in being part of a team that is open, collaborative, entrepreneurial, passionate and above all fun.\n\n\nAbout the platform\n\nProphet is a leading risk management platform used by the financial services industry around the world to model companies’ financial business.\nOur team is starting new Prophet SaaS project. It will be the system with single web interface and microservices run in docker containers on AWS Cloud. It’ll enable the execution of processes that perform in depth calculations based upon the actuarial models.\n\n\nWhat you will be doing\n\nYou will be a part of the Prophet SaaS team as lead technical expert with significant functional understanding, responsible for guiding application development through the development process, mapping functional requirements to technical solutions, harnessing the interdependencies between applications and subsystems, and leveraging both leading-edge and industry-proven technologies to build modern, performant, and effective applications.\n\n- Hands-on code development and technical leadership\n- Lead by example in creating code that adheres to defined standards and raises the bar with respect to quality. Challenge your colleagues to do the same. Optimize applications to ensure high performance and scale\n- Create high-level / low-level design documents based on the business requirements\n- Participate in design reviews and in code reviews\n- Maintain current knowledge of software development practices\n- Practice good coding techniques (reusability of code, code optimized for performance, etc.)\n- Resolve programming problems / answer questions\n- Requirements gathering\n- Working with QA engineers and business analysts'
       , '300000 RSD (mesečno)', TRUE),
       (7, 2, 5, '2021-02-01 03:20:8.360', 'Java Team Lead', 'Who are we?\n\nHyperoptic is the UK''s hyperfast broadband network. Founded in 2011 to shake up the UK broadband market, we''re leading the way in full fibre technology. Our top average wired speed (900Mbps on our hyperfast 1Gb product) is over 11x faster than the UK''s average broadband speed.\n\nWe established Hyperoptic''s Belgrade office in 2013, starting with only 20 Developers to support the business. As of today we are 400 people and growing superfast - once a small start-up has become a success story in Belgrade, with over 1300 employees globally.\n\nDue to continuous expansion Hyperoptic are hiring for a Lead Developer who goes beyond the expected. We believe in working smarter together, whilst our teams stay focused and people passionately strive for excellence. As Lead Developer your mission will be being responsible for managing and leading a software development team in the effective design, implementation and operation of software products and services. A technical expert in software development. Sets clear team goals and KPIs. Delegates tasks and estimates project deadlines. Oversees day-to-day teams'' operation and performance. Does regular performance evaluation. Create a healthy and motivating work environment and atmosphere. Does this sound like you?\n\nWhat will you be doing?\n\n\n - Guide team development efforts towards successful project delivery\n - Provide technical leadership to teammates through coaching and mentorship\n - Maintain high standards of software quality within the team by establishing good practices and habits\n - Identifie and encourage areas for growth and improvement within the team\n - Collaborate with other software developers, business analysts and software architects to plan, design, develop, test, and maintain\n - Assist in the collection and documentation of user''s requirements, development of user stories, estimates and work plans\n - Prepare reports, manuals and other documentation on the status, operation and maintenance of software\n - Design and develop software in accordance with established standards\n - Participate in peer-reviews of solution designs and related code\n - Analyze and resolve technical and application problems\n - Assesse opportunities for application and process improvement and prepare documentation of rationale to share with team members and other affected parties\n - Adhere to high-quality development principles while delivering solutions on-time and on-budget\n - Provide third-level support to business users\n\nWhat are we looking for?\n\n - University level education in computer science or similar developmen\n\n - Any additional development certifications or course\n\n - 5+ years of software development experienc\n\n - Technical development expertis\n\n - Extensive knowledge on industry standards, operating systems, networks, architectures, best practices and pattern\n\n - Experience with containerised and cloud deployment (AWS, Google Cloud, Azure…\n\n - Creative, intelligent, analytical and detail oriente\n\n - Fluent in English\n\nWhy are we the best place for work?\n\nWe are based in three beautiful locations in Senjak with:\n\n - Catered lunch every day\n - Basketball court and table tennis\n - Fresh fruit every week\n - Massage on site\n - Pet friendly office\n\nWe''re committed to providing equal opportunities to all applicants and employees – in fact this is at the heart of our company culture and values. We welcome applications from candidates with diverse backgrounds.\nWhat happens next?\n\nYou apply.\n\nWe carefully review your application over a decent cup of coffee.\n\nWe''ll get back to you. Even if it''s a no (at the moment).\n\nHyperoptic has been recognized in the top three for the Best Recruitment Process amongst Belgrade IT Companies, three years in a row.\n\nPlease submit your application in English.\n\nWe look forward to hearing from you!'
       , '500000 RSD (mesečno)', FALSE),
       (7, 2, 2, '2021-02-11 08:38:20.420', 'Medior C++ Developer', 'Protech is a team of experienced engineers working on cutting-edge projects in the fields of applied Computer Vision and Machine Learning.\n\nWe are looking for a creative and skilled C++ developer that will join our team. You will be working on new features using state-of-the-art technologies in a cross-functional environment, closely working together with your colleagues to make sure everyone is involved in all updates/iterations.\nResponsibilities\n\n - As a part of the R&D team, you will work on researching and implementing new feature sets for current and future clients.\n - Support the whole development process ranging from initial analysis, architecture design, implementation, documentation and maintenance of CV/ML solutions.\n - Systematically test your algorithms’ performance and optimize their robustness and accuracy under real-world conditions.\n - You will work closely with the algorithm development team on integrating the latest R&D results into the product codebase.\n - Optimize your solutions for execution on different platforms and prepare them for transitioning into reliable products.\n - Together with the product manager, you will be responsible for creating correct project estimates, regarding time and effort.\n\nRequirements\n\n - At least 2 years of professional experience in C++ software development\n - Good knowledge of the standard library, STL containers and algorithms\n - Knowledge of the recent C++ (14, 17) standards\n - Knowledge of Git or other source control management systems and interaction with CI/CD tools (e.g. Jenkins)\n - Experience with unit testing\n - Experience in working, developing and deploying of solutions for different operating systems (Windows, Linux, etc.)\n\nAdvantages\n\n - Experience with Computer Vision / Machine Learning\n - Experience with OpenCV\n - Experience with ML frameworks (OpenCV, Tensorflow, Keras, PyTorch, etc.)\n - Experience with Python\n - Experience with Docker\n - Experience in software porting, cross-compiling & optimization for different end platforms (Intel or ARM based CPU, Nvidia GPU, etc.)\n\nProfile\n\n - University degree in a technical field or comparable work experience\n - Proficient in spoken and written English\n - Proven 2+ years of professional experience in development of C++ solutions\n - Detail-oriented and organized\n - Independent thinker\n\nWhat we offer\n\n - Competitive salary with good work-life balance\n - Transparent communication and strong team spirit\n - Flat organizational structure \n - Recognition for your personal contribution\n - Working in a stable, supportive and friendly environment\n - Flexible working hours, overtime hours are an exception, not a rule\n\nSeniority Level: Medior\nEmployment Type: Full-time'
       , '60000 EUR (godišnje)', FALSE),
       (8, 1, 1, '2021-05-21 08:38:20.420', 'Prodavac u Call Centru', 'Prodavac u call centru prima pozive i kontaktira kupce koji su gledali naše emisije "Vaše zdravlje, naša briga" na nacionalnim i regionalnim televizijama.\n\nAgent - prodavac u call centru komunicira sa kupcima koji pozivaju naš broj telefona i telefonskim putem vrši prodaju i prima porudžbine klijenata.'
