       (8, 1, 8, '2021-07-18 05:38:20.420', 'Radnik u maloprodaji (pekari)', 'Zmaj Pekara je brend Industrije hleba Ivanović koja postoji već dugi niz godina i nudi brzu i kvalitetnu uslugu, u domenu domaće i internacionalne pekare.\n\nU cilju proširenja, kompanija otvara restoran pekarskih i poslastičarskih proizvoda u gradovima: Kraljevo, Lazarevac, Smederevo i Čačak. Shodno tome, raspisujemo konkurs za radno mesto: Radnik u maloprodaji (pekari).\nOsnovni zadatak radnog mesta:\n\n - Narastanje i pečenje proizvoda\n - Usluživanje kupaca u maloprodajnom objektu\n - Rad na kasi\n - Rad po smenama\n\nNašim zaposlenima nudimo:\n\n - Zasnivanje radnog odnosa na neodređeno vreme\n - Rad u kompaniji koja ceni dobre radnike i plaća kvalitetan rad\n - Sigurnu i redovnu isplatu\n - Dinamično okruženje\n - Brz i profesionalan razvoj u karijeri\n\nUslovi:\n\n - Minimum III stepen stručne spreme'
       , '30000 RSD (mesečno)', FALSE),
       (8, 1, 1, '2021-03-25 01:15:8.360', 'Sales Department Manager (Vođa prodaje)', 'Most people see a watering can.\nWe see the individual growth opportunity in everyone.\n\nSales Department Manager (Vođa prodaje), Sales Department, IKEA South East Europe, Belgrade Store\n\nYou see things a little differently. So do we. We believe that what you value is more important than what your CV says. We offer positions that will challenge your skills and let you grow.\nAbout You\n\nYou are/have:\n\n - Passionate about inspiring, leading and developing people to create everyday growth in our local market\n - Business-minded and result-driven with a customer focus\n - Experience of customer-oriented services or retail\n - Experience of actively selling through understanding customers and their needs\n - Understanding of the local market and competition\n - Interest in people’s everyday life at home and home furnishing\n - Open to change\n - Ability to make quick decisions and take initiatives\n - Ability to create a high commercial performance\n - Numeracy and computer literacy\n - Ability to communicate in English.\n\nAbout the job\n\nWe deliver sustainable, extraordinary growth by creating a new, unique, inspiring and convenient meetings with the customers. We deliver a multi-channel experience that adds value to the many people and inspires a home furnishing movement. Your task will be to optimize sales growth and customer experience through all kind of services at different customer meeting points to secure an excellent end to end experience.\nAbout the assignment\n\nYou will:\n\n - Ensure the shop is in excellent shape as new and fully and efficiently always stocked and that the IKEA product range is presented in ways that inspire and satisfy customers\n - Ensure your team has all the correct knowledge about the product range in your department and the IKEA services so that they can share this with IKEA customers to improve their overall shopping experience\n - Understand the different IKEA sales and communication channels and IKEA know-how to make the best commercial use of this information for different customers\n - Take responsibility for your department goals and secure that your action plan ensures the country priorities for your Home Furnishing Business (HFB) are implemented in your store. You follow up and act accordingly by using proven solutions and good examples\n - You develop you team members as individuals and as team, ensuring that results are delivered through people\n - Actively cooperate with all key stakeholders within commercial and beyond to secure integration, common focus and to maximize customer satisfaction and deliver agreed results\n - Be an active player in driving an open and sharing climate, be a role model of the organizational values.\n\nIKEA South East Europe is an exciting and empowering region with great growth agenda in all countries – Croatia, Romania, Serbia, Slovenia and Ukraine. We currently operate 6 stores and we will open 1 new one in the upcoming period.\n\nWe strongly encourage and warmly welcome applications of people of all cultures, backgrounds and experiences because we believe that diversity in IKEA makes us stronger.\n\nJoin IKEA now and apply for the position online in English.'
       , '90000 RSD (mesečno)', FALSE),
       (8, 1, 2, '2021-06-17 03:20:8.360', 'Akviziter prodaje', 'Mi smo Teledirekt, partner Telekoma Srbije u plasmanu i prodaji telekomunikacionih usluga. Prodajemo box pakete, telefonske i internet usluge korisnicima koji žele najbolju kupovinu i najkvalitetniju uslugu za svoj novac. Korisnicima koji ne prave kompromis sa kvalitetom.\n\nNaš posao je da sadašnjim i budućim kupcima pomognemo da donesu za njih najbolje odluke u situaciji kada odlučuju o teleoperateru. Danas, kada internet predstavlja prozor u svet, mi smo tu da savetom prijatelja pomognemo u odlučivanju našim korisnicima.\n\nDa bismo u ovome bili još uspešniji, potrebni su nam novi članovi tima.\nMi vam nudimo:\n\n - Ugovor o radu na neodređeno vreme i prijavu od prvog dana stupanja na posao\n - Fiksnu zaradu i stimulativne bonuse prema ostvarenim rezultatima\n - Kvalitetnu stručnu obuku u saradnji sa Mokrogorskom školom menadžmenta\n - Mogućnost napredovanja i profesionalni razvoj\n - Izuzetno prijatnu radnu atmosferu i kolegijalne odnose\n - Tim building i sportske aktivnosti\n - Adekvatnu novčanu stimulaciju za sve važne događaje u životima naših zaposlenih\n\nTražimo ljude koji zrače dobrom energijom, koji u terenskom poslu vide slobodu, koji vole da sami prave svoje planove ali su uvek tu i ako timu treba pomoć; optimiste koji ne gube snagu ako ne pobede svaki put, koji sami određuju visinu zarade svojim radnim rezultatima.\n\nTražimo ljude koji su nasmejani i spremni da ponosno nose našu crvenu boju.\n\nPrethodno radno iskustvo vam nije neophodno ako ste spremni da učite veštine direktne prodaje.\n\nDovoljno je da ste spremni za izazove i da verujete u sebe.\n\nNe testiramo znanje stranog jezika i kompjuterske veštine za ove poslove.\n\nTestiramo energiju, optimizam i želju za učenjem i napredovanjem.\n\nAko se prepoznajete u ovom opisu, javite se pa da zajedno rastemo i osvajamo nove visine i ciljeve.\n\nDajte sebi šansu da proverite svoje granice. Sjajna ekipa je već ovde, budite naše pojačanje.'
       , '840000 RSD (godišnje)', FALSE),
       (8, 1, 3, '2021-04-02 08:38:20.420', 'Prodajni savetnik', 'Ovlašćeni diler Peugeot vozila, kompanija KDD Auto, proširuje svoj prodajni tim sa ciljem daljeg kontinuiranog rasta i podizanja standarda u prodaji vozila.\n\nUkoliko imate iskustva u prodaji vozila ili ste spremni za nove izazove, fokusirani na ostvarenje ciljeva, timski rad i učenje, prijavite se za poziciju Prodajni savetnik.\nUslovi za kandidate:\n\n - VS, VSS\n - Vozačka dozvola B kategorije\n - Aktivno znanje engleskog jezika\n - Iskustvo u oblasti prodaje vozila\n\nOpis posla:\n\n - Prodaja novih vozila\n - Briga o klijentima tokom celokupnog prodajnog procesa\n - Izrada kompletne dokumentacije prilikom prodaje vozila\n - Ostvarivanje zadatih ciljeva u prodaji\n - Saradnja sa finansijskim i osiguravajućim kućama na planu finansiranja i osiguranja vozila\n - Praćenje konkurencije i savremenih trendova u automobilskoj industriji\n\nVaš profil: \n\n - Komunikativni sa razvijenim veštinama pregovaranja\n - Usmereni na postizanje rezultata\n - Ljubitelj i poznavalac automobilske industrije\n - Timski rad\n - Spremni za učenje\n - Odgovorni \n\nBiće kontaktirani samo kandidati koji uđu u uži izbor.'
