       (9, 2, NULL, '2021-05-13 02:36:54.480', 'Front End Web Developer', 'We are an IT company occupying a remarkable place in marketing, gaming and financial segments of the iGaming industry. Our products are successfully implemented in European, African and Latin American markets.\n\nEver since we first started, we have been driven to find the best solutions in everything we do. At the same time, we have been creating strong connections all over the world which has helped us to establish our presence in the industry.\n\nWe strive for fun, elegance, and efficiency in everything we do. You can feel this in our relaxed, homelike working environment perfectly. We offer employment and seek to hire only the brightest, most driven, and most gifted minds around.\n\nWe are looking for a: Front End Web Developer\n\n\nDescription:\n\nWe’re looking for a Front End Developer to join our team on full-time employment in our office in New Belgrade, who will maintain the existing code base for the current stack, as well as help us migrate our projects to Vue. Now is the perfect time to join the team to get familiar with the structure before we’re fully focused on the migration.\n\n\nResponsibilities:\n\n- Work on a variety of tasks assigned by project managers and lead developers\n- Implement new user interfaces\n- Improve the existing code base\n- Build maintainable applications\n- Utilize latest front-end technologies which are adequate for the given task\n- Participate in front-end decision making\n- Be a proactive team member and be vocal\n\n\nYou are ideal candidate for us if you have:\n\n-Deep understanding of core JavaScript (ES6+)\n- Excellent knowledge of CSS and SASS\n- Worked with one of the major frameworks (Vue, React or Angular)\n- Experience with Git\n- Experience with package managers (npm or yarn)\n- Desire to adapt to latest development standards and technologies\n- Great verbal and written English\n\n\nWill be a plus if you have experience with:\n\n- Twig\n- Cross browser testing and tools\n- Testing frameworks (Jest, Mocha, etc.)\n- BEM\n- Linux environment\n- Typescript\n- Communicating with project managers and lead developers\n\n\nSalary range\n\n- 800-1500 EUR net, depending on experience\n\n\nWe offer:\n\n- Young & international team, friendly creative atmosphere and the space to pursue your ideas\n- Professional growth and improvement, participation in seminars and conferences\n- Unforgettable corporate team building events\n- Flexible working hours (work day starts between 08:00 - 11:00)\n\n\nSelection process:\n\n- Qualified applicants will be invited to an interview which covers the HR and technical part\n- Shortlisted candidates will then be assigned a small task which has a deadline of 48 hours, but realistically it could be done in a few hours\n- Selected candidates will get a job offer\n\nFeel free to apply even if you don’t have experience with all of the requirements!'
       , '800 - 1500 EUR (mesečno)', TRUE),
       (9, 2, 4, '2021-04-07 05:38:20.420', 'Front-end Web Developer (HTML, CSS)', 'We are Computer Rock, an international software company based in Switzerland.\n\nWith offices in Belgrade, Zurich, Hamburg and London we combine international perspective with local market insights while living by European values and diversity. We develop platforms and services for international customers with focus on Swiss, German and English markets.\n\nWe are looking for the Front-end Web Developer (HTML, CSS) who will be working on web sites for major worldwide brands. Creating unique user interfaces and web site templates using the latest Web tech will be your primary responsibilities.\n\nThis is a full-time position.\n\n\nYou are the right candidate for us if you have:\n\n- Mastery in writing HTML5 and CSS3 (including SCSS)\n- Strong knowledge of JavaScript / jQuery\n- Excellent eye for design, pixel-perfection attitude with references in place\n- Experience in building reusable components\n- Experience in using BEM or similar methodologies\n- Strong knowledge of Git and various Git workflows\n- Enthusiastic and independent\n- Confident spoken and written English\n\n\nIt would be a bonus to have:\n\n- Experience in using some of the modern JavaScript frameworks (AngularJS, React, Vue.js, etc.)\n- Knowledge of PHP or other programming languages\n\n\nYour responsibilities will be to:\n\n- Work closely with product managers, designers, and backend engineer\n- Participate in Scrum team\n- Delivering high quality, maintainable and well-tested cod\n- Following team coding standards and processes\n- Being able to prioritize and finish multiple tasks on a projec\n- Implementing user interface from provided mockups & designs\n- Ensuring UI meets given requirements (browsers, resolutions, input methods)\n- Fixing defects and maintaining existing products\n\n\nWhy is Computer Rock a good and attractive place to work?\n\n- We are experts in the industry\nWe have a 10 years long track record of successfully concepting, designing, developing and operating digital products and helped clients across a diverse set of industries like insurance, automotive, media, telecommunications, e-commerce, medicine and iOT\n- We make you feel happy at work\nWe nurture team spirit, knowledge sharing as well as mutual assistance and respect in the workplace. Our Management is in line with developers and we collaborate with each other on equal footing.\n- We support your personal and professional development\nAll seniority levels are represented in each team and we encourage the mentoring culture. We are using the latest technologies and devices in day-to-day work, which enables your continuous professional development. At team level, various educational presentations are organised to keep employees up to date with modern technologie.\n- We Provide you with various employee benefits\nWork flexibilities such as: remote or office work, flexible work hours, up to 27 days of vacation per year, depending on your length of service, as well as private health insurance. From this year onward, we are going to introduce personalized benefits.\n\n\nWhere are we based?\n\n- Our office building is located in Belgrade downtown, 50 meters away from Kalemegdan\n\n\nWhat does a selection process look like?\n\n- We will contact only short-listed candidates.\n- We optimized the process in just one interview. It will contain both the HR and technical interview.\n- The interview will take about an hour. If the interview goes well, you will receive an email with our offer.\n\n\nWhat you need to do?\n\n- Send your application, including the CV electronically.\n- Please be sure to include links to your clickable references or Github\n- If you want to ask additional questions about this position or want to talk about our company, feel free to contact us on: hr.belgrade@computerrock.com\n\nThank you for showing interest in our company.'
       , NULL, FALSE),
       (9, 2, NULL, '2021-02-18 01:15:8.360', 'DevOps Engineer', 'We are Computer Rock, an international software company based in Switzerland.\nWith offices in Belgrade, Zurich, Hamburg and London we combine international perspective with local market insights while living by European values and diversity. We develop platforms and services for international customers with focus on Swiss, German and English markets.\n\nWe are looking for an experienced DevOps Engineer who has a genuine interest and flair for technology regardless of the platform involved.\n\nYou’ll be improving the backbone infrastructure for an ever expanding client base that relies on our tier 1 service offering. As part of your remit, you will be involved in analyzing, designing, planning, implementing, testing and automating the infrastructural setup that is required.\n\nThis is a full-time position.\n\n\nYou are the right candidate for us if you have experience with:\n\n- Amazon AWS, Microsoft Azure, Google Cloud or other cloud setups\n- Configuring web servers Nginx, Apache or IIS\n- Virtualization tools (Kubernetes, Helm or Docker), IaaC and configuration management tools (Terraform, Terragrunt or Ansible)\n- Continuous Integration and Deployment systems (Jenkins, Gitlab CI/CD)\n- Configuring database servers (MySQL, Postgres, ElasticSearch, MongoDB, Redis)\n- Comfortable administering and securing both Debian and RedHat based flavours of Linux\n- Scripting – Shell scripting or Python\n- Monitoring tools (Nagios, Grafana with Prometheus, ELK stack)\n- Load balancing\n\n\nWe expect that:\n\n- There are no secrets for you with network protocols and network administration\n- You are able to take the lead on projects – taking the initiative where required\n- You are passionate for technology in the areas as defined above\n- You are able to learn quickly\n- You are reliable and trustworthy\n\n\nNice to have:\n- A computer science background\n- Experience with Hadoop, Apache Kafka or similar technologies\n- DBA experience especially in the area of database clustering\n-Experience with high performance / high availability web applications\n- Confident spoken and written English\n- Experience of working in teams\n\n\nWhy is Computer Rock a good and attractive place to work?\n\n- We are experts in the industry\nWe have a 10 years long track record of successfully concepting, designing, developing and operating digital products and helped clients across a diverse set of industries like insurance, automotive, media, telecommunications, e-commerce, medicine and iOT.\n- We make you feel happy at work\nWe nurture team spirit, knowledge sharing as well as mutual assistance and respect in the workplace. Our Management is in line with developers and we collaborate with each other on equal footing.\n- We support your personal and professional development\nAll seniority levels are represented in each team and we encourage the mentoring culture. We are using the latest technologies and devices in day-to-day work, which enables your continuous professional development. At team level, various educational presentations are organised to keep employees up to date with modern technologies.\n- We Provide you with various employee benefits\nWork flexibilities such as: remote or office work , flexible work hours, up to 27 days of vacation per year, depending on your length of service, as well as private health insurance. From this year onward, we are going to introduce personalized benefits.\n\n\nWhere are we based?\n\nOur office building is located in Belgrade downtown, 50 meters away from Kalemegdan.\n\n\nWhat does a selection process look like?\n\n- We will contact only short-listed candidates.\n- We optimized the process in just one interview. It will contain both the HR and technical interview. The interview will take about an hour.If the interview goes well, you will receive an email with our offer.\n\n\nWhat you need to do?\n\n- Send your application, including the CV electronically.\n- Please be sure to include links to your clickable references or Github\n- If you want to ask additional questions about this position or want to talk about our company, feel free to contact us on: hr.belgrade@computerrock.com\n\nThank you for showing interest in our company.'
