       (9, 2, 5, '2021-03-23 03:20:8.360', 'Lead Programmer', 'Job Description\n\nUbisoft Belgrade is looking for a talented Lead Programmer to join our growing team of 200 people! Our expectations of a Lead Programmer are more people oriented. Technical expertise in C++ and the experience in the gaming industry is a plus but it’s not necessary.\n\nAs a Lead Programmer your responsibilities are towards the team, tracking their progress and making sure they are reaching milestones and agreed upon goals. You''ll be assisting your team in handling communication with multiple departments, removing any obstacles, helping them identify road blockers and managing them. Setting personal goals for each of your team members and helping them grow both technically and with their soft skills. You''ll be closely collaborating with Leads from our partner studios and aligning on mutual technical goals, but also with various internal stakeholders like Project Coordinators, Producers etc. The Lead Programmer’s responsibilities also include participating in our hiring process by conducting technical interviews with candidates. Together with management you will be making organizational and technical decisions for your project.\nUbisoft\n\nOn top of that on any one day you might:\n\n - Delegate tasks\n - Manage day-to-day activities of your team\n - Have a regular meeting with someone from your team to keep track of their motivation and performance; participate in yearly performance reviews\n - Analyze complex problems with your development team and help them find relevant solutions to it\\n - Collaborate with other Lead Programmers, both in our studio and in other Ubisoft studios involved on the project\n - Organize onboarding and mentoring for new people in your team\n\nQualifications\n\nMust have:\n\n - Programming expertise, with solid experience working in an agile development environment in an international setting\n - Experience in developing, managing, coaching, mentoring programmers and conducting performance reviews \n\nNice to have:\n\n - Knowledge of Atlassian tools (Jira, Confluence)\n - Experience in game development and interest for games\n - Knowledge and passion about software development \n\nJoin us and become a key part in the gaming world!'
       , '8000 - 9500 EUR (mesečno)', FALSE),
       (9, 2, 5, '2021-07-28 08:38:20.420', 'Junior Quality Assurance Engineer', 'GET (Global Engineering Technologies) is an established international company, basedin Belgrade, successful in delivering various industry-specific innovative IT solutions and developing in-house software products. Our team is made of more than 200 software engineers, business analysts, and business domain experts. Our clients employ between 5.000 and 125.000 team members. We are a reliable partner of SAP, Atlassian, Microsoft, and Cisco.\n\nGET was founded by IT engineers driven by the idea of building a company that isconstantly striving to improve its products and services. We have a proven track record of success in providing solutions in the automotive industry, logistics, finance/banking, production, and retail. We nurture long-lasting cooperation, trust, and continuous development with our clients, as well as with our team members.\n\nWe are GET. And we grow together as a team.\n\nClick to GET Inside: www.global-engineering-technologies.com/get-inside\n\nWe are looking for: Junior Quality Assurance Engineer.\n\nYou can become a member of an inspiring engineering team that is responsible for the functional support and the maintenance of different infrastructure products and platforms.\n\nAmong others, your tasks will be to provide functional support to users and customers, to communicate and coordinate inside a large organization, as well as to perform system administration tasks. As a member of our team you will have the chance to engage in this exciting new field, learn new technologies and progress rapidly.\nRequirements:\n\n - You are a final year student, or you have a University Degree (preferably FON, ETF, MATF, RAF, etc.)\n - Approaching a product with the attitude that the product or system is inherently flawed and it is your job to ‘illuminate’ the flaws\n - Strong analytical skills with a mindset that questions assumptions; with a willingness to continuously help improve processes and procedures\n - Ability to work independently with a willingness to share knowledge with peers to improve the quality of the team on the whole\n - You are organized and proactive\n - Ability to check results of tests in application and in database also (basic knowledge of SQL)\n - Strong listening skills; Good verbal and written communication skills within the team and with clients; Ability to adjust content of written/verbal communication to the audience\n - Ability to analyze and classify reported issues\n - Ability to learn and support new tools as required\n - Genuine curiosity and striving for new knowledge\n\nWhat would set you apart from other candidates?\n\n - Experience in manual testing\n - Experience in writing test cases, test plans and strategies\n - Experience in API testing, E2E testing, working with Postman or Selenium\n - Ability to translate technical details into descriptions the customer can understand\n - Experience with a bug tracking tool like JIRA\n - Proficient with test management software tools like XRay or Quality Center\n - Proficient in a source control systems\n\nWhat is there for you as a part of GET?\n\n - An attractive compensation plan that matches with your professional development\n - A long-term career path with us\n - Involvement in project assignments with diverse technologies\n - Working in small and highly-skilled teams with dedicated mentorship\n - Great experience working for top-tier clients worldwide\n - Access to private healthcare and sports facilities\n - Possibility to travel abroad\n\nWe are pleased that you have taken the first step to finding out about a career at Global Engineering Technologies. In order to ensure the most professional treatment of your application, GET is exclusively using online applications.\n\nPlease note that only shortlisted candidates will be contacted.'
       , '30000 EUR (godišnje)', FALSE),
       (10, 11, NULL, '2021-07-17 02:36:54.480', 'Junior grafički dizajner', 'Cherry čini mali kreativan, energičan i vredan tim profesionalaca, sačinjen od marketinških konsultanata, dizajnera i programera, a posvećen traganju za maštovitom pričom i rešenjima za Vaše poslovanje.\n\nRaspisujemo konkurs za poziciju: Junior grafički dizajner\n\nTražimo Junior grafičkog dizajnera za kreiranje efektnih dizajnerskih rešenja, koja će u svemu promovisati viziju naše kompanije. Na ovoj poziciji ćeš imati priliku da učestvuješ na velikom broju projekata povezanih sa razvojem brenda, razvojem profila na društvenim mrežama, kao i štampanog materijala. U naš tim se uklapa osoba koja voli da sarađuje sa ostalim članovima tima, željna je dokazivanja, osoba koja ima oštro oko za detalje, kreativna, željna učenja i sticanja novih iskustava, sposobna da razume potrebe klijenata i da bude njihova kreativna podrška. Ukoliko misliš da si naš novi član tima pošalji nam svoj CV i portfolio manji od 5MB u atačmentu, veći od 5MB - link ka radovima.\nOsnovna zaduženja i odgovornosti: \n\n - Osmišljavanje i izrada grafičkih rešenja prema dobijenim smernicama\n - Izrada grafičkih rešenja za objave na društvenim mrežama i rešenja za websajtove\n - Izrada grafičkih rešenja za druge medije\n - Praćenje grafičkih standarda kompanije i njenih brendova\n - Osmišljavanje i predlaganje aktivnosti koje će unaprediti nastup klijenta na tržištu\n - Saradnja sa članovima tima i promovisanje vrednosti i vizije kompanije u eksternoj i internoj komunikaciji i ponašanju\n - Poštovanje dogovorenih rokova za izradu ili predlaganje grafičkih rešenja\n\nSposobnosti, znanja i veštine: \n\n - Minimum SSS, IV stepen (grafički dizajn)\n - Odlično poznavanje rada na računaru: Adobe paket (Photoshop, Illustrator, InDesign), Corel Draw, MS Office paket\n - Kreativnost, preciznost, samostalnost u radu, inicijativa, komunikativnost, sposobnost rada u kratkim rokovima\n - Znanje engleskog jezika (minimum srednji nivo)\n - Poželjno je 2 godine relevantnog iskustva.\n\nVolimo da radimo sa ljudima i da nove članove tima dočekamo spremni sa svim informacijama radi njihove lakše integracije kao deo tima. Nudimo vam rad u stabilnoj kompaniji okrenutoj rastu i razvoju kako celine, tako i pojedinačnog unapređenja veština svakog od članova tima.\n\nPrijavom na ovaj konkurs saglasni ste da Vas, ukoliko ne budete izabrani u prvom krugu selekcije, možemo kontaktirati u narednom periodu, ukoliko se ukaže potreba za istim ili sličnim radnim mestom. Svi podaci biće arhivirani u našoj bazi podataka i biće dostupni samo saradnicima u HR procesu. U proces selekcije će biti uključeni samo kandidati koji ispunjavaju tražene uslove, a svi kandidati koji prođu administrativnu selekciju biće obavešteni o krajnjem ishodu.'
       , NULL, TRUE),
       (10, 11, NULL, '2021-05-21 05:38:20.420', 'Graphic Designer', 'We are continually looking for new opportunities in the internet world, and for this, we''re looking to assemble a team of highly motivated and smart individuals who will further our network.\n\n\nTo that end, we are looking for a competent: Graphic Designer\n\nwork from home\n\nfull-time freelance position\n\n\nJob Description \n\nAs a Graphic Designer, you will be working with a team of developers and designers on a platform that connects streamers, YouTubers, and content creators with their audience. Your job will be to create beautiful profile pages for the content creators on our platform. \n\nTherefore, a keen eye for details, innovative and creative thinking, as well as previous experience working in graphic design are mandatory. A curious and dynamic attitude, positive outlook as well as a market-oriented mindset are also a must.  \nResponsibilities\n\n - Work closely in a team in a productive manner\n - Design the avatar, background and banners for content creators\n - Based on their preferences, create an individual style for every creator \n - Prepare the visuals for use on the website\n\nRequirements\n\n - Previous work experience in graphic design (one year minimum)\n - Advanced knowledge of Adobe Photoshop, Adobe Illustrator, After Effects and CorelDraw\n - Ability to work with composition, typography and color\n - Goal-driven attitude and an ability to meet deadlines\n - Familiarity with the latest trends in graphic design\n - A perfectionist attitude and a strong attention to detail=\n\nNice-to-haves\n\n - Comfortable working in a deadline-driven environment and with a productivity tracking  tool such as Time Doctor\n - Capable of sitting 8 or more hours behind the computer\n - Being able to acquire new information quickly and put it to use\n - Available for occasional work over the weekend\n - Able to accept and implement feedback \n\nBenefits\n\n - Performance-based bonuses\n - Ability to work from home with flexible hours for the foreseeable future\n - Working in a results-oriented environment\n - Starting salary range: €600 – €1200 per month depending on your graphic design skills\n\nDoes the position of a Graphic Designer speak to you and is it something you’d excel at? If that’s a yes, click on Apply Now and send us your CV and portfolio in English. If you do not submit a portfolio with your CV, we won’t take your application into consideration.\n\nTo ensure your qualifications match the company’s goals, we’ve created a multi-step selection process that will assess your skills. The process includes paid test assignments, as well as interviews so that we can get to know you better. Therefore, give it your best shot and get ready to use this opportunity to the fullest.'
       , '600 - 1200 EUR (mesečno)', TRUE),
       (10, 11, 1, '2021-01-19 01:15:8.360', 'UX/UI Designer', 'We are continually looking for new opportunities in the internet world, and for this, we''re looking to assemble a team of highly motivated and smart individuals who will further our network.\n\nTo that end, we are looking for a competent: UX/UI Designer (work from home - full-time freelance position).\nJob Description \n\nAs a UX/UI Designer, you will be responsible for creating beautiful and user-friendly interfaces for our websites. You’ll design responsive and adaptive layouts as well as create user behavior scenarios for our platform. You’ll help us identify weak points, suggest improvements, and work on implementing the best web design practices on our web pages.\n\nTherefore, a keen eye for details, innovative and creative thinking, as well as previous experience working as a UX/UI designer are mandatory. A curious and dynamic attitude, positive outlook as well as a market-oriented mindset are also a must.  \nResponsibilities\n\n - Work closely in a team in a productive manner\n - Develop complex and attractive web interfaces\n - Create page designs with the best UX/UI practices in mind\n - Design and improve user behavior scenarios\n - Design responsive and adaptive web page layouts\n\nRequirements\n\n - Previous work experience in UX/UI (1-3 years minimum)\n - Advanced knowledge of Figma, Adobe Photoshop, and Adobe Illustrator\n - Ability to work with composition, typography, and color\n - Goal-driven attitude and an ability to meet deadlines\n - Familiarity with material design and iOS design guidelines\n - A perfectionist attitude and strong attention to detail\n\nNice-to-haves\n\n - Comfortable working in a deadline-driven environment and with a productivity tracking  tool such as Time Doctor\n - Capable of sitting 8 or more hours behind the computer\n - Being able to acquire new information quickly and put it to use\n - Available for occasional work over the weekend\n - Able to accept and implement feedback \n\nBenefits\n\n - Performance-based bonuses\n - Ability to work from home with flexible hours for the foreseeable future\n - Working in a results-oriented environment\n - Starting salary range: €1000 – €3500 per month depending on your UX/UI design experience and skills\n\nWhat’s next?\n\nDoes the position of a UX/UI Designer speak to you and is it something you’d excel at? If that’s a yes, click on Apply Now and send us your CV and portfolio in English. If you do not submit a portfolio with your CV, we won’t take your application into consideration.\n\nTo ensure your qualifications match the company’s goals, we’ve created a multi-step selection process that will assess your skills. The process includes paid test assignments, as well as interviews so that we can get to know you better. Therefore, give it your best shot and get ready to use this opportunity to the fullest.'
       , ' 1000 - 3500 EUR (mesečno)', FALSE),
       (10, 11, 5, '2021-02-11 03:20:8.360', 'Prodavac-enterijerista', 'Tražimo dobrog prodavca motivisanog da prodaje lepe i kvalitetne tapete, zavese... da zarađuje u skladu sa svojim zalaganjem i veštinom kojom iskaže u prodaji.\nPrednost imaju:\n\n    dizajneri enterijeristi, arhitekte, ili kandidati sa iskustvom u saradnji sa arhitektama, izvođačima završnih radova u enterijeru.\n\nNeophodni uslovi:\n\n - Pozitivan stav u poslu, a posebno u prodaji (da kandidat voli sektor prodaje i da ga rad i uspeh u ovom sektoru ispnjava)\n - Poznavanje osnova poslovanja ( sastavljanje ponude, poslovna korespodencija)\n - Položen vozački ispit\n - Znanje engleskog jezika\n - Da je voljan da uči i da se usavršava\n\nMara home je uspešna kompanija koja brine o zadovoljstvu svojih zaposlenih, a više o našoj ponudi možete pogledati na:'
       , '60000 - 100000 RSD (mesečno)', FALSE),
       (10, 11, 2, '2021-06-13 08:38:20.420', 'UI/UX Figma Designer - Independent Test PASS', 'Attention: This job qualifies under the Independent Test for new tax law.\n\nAre you looking to work with the latest technologies in Big Data for an award-winning software company? Smart Apartment Data is an employee-rated five-star company and a winner of the ‘Houston Best & Brightest Companies to Work for ‘, we place strong emphasis on offering a fun work-environment, generous pay with bonuses, individual growth, and a healthy work-life balance. \nWho are we?\n\nFounded 16 years ago, Smart is now the premier data analytics platform for the housing industry in the United States. We are utilizing Big Data to offer market intelligence real estate brokers, investors and analysts.\nWho are we looking for?\n\nWe are looking for someone fluent in English with the ability to express their creativity and talents through interesting projects and with experienced developers.\nSneak peak of projects:\n\n - Big Data Analytics\n - Modern UI designs and room for creative expression\n - New mobile and desktop app re-designs\n\nWe are looking for someone who:\n\n - Fluent in English (C1 – advanced)\n - Minimum 2 years of UI UX experience\n - Good understanding of Figma\n\nBenefits\n\n - Location Independent / 100% Remote\n - Flexible working hours\n - Competitive base salary with guaranteed annual bonus\n - Work with latest and cutting-edge technologies\n\nBE SURE to read our 5 star company reviews: https://www.glassdoor.com/Reviews/SMART-Apartment-Data-Reviews-E1004409.htm\nThink you fit the description?\n\nApply as soon as possible since we do go through all applicants daily.'
       , '3000 - 4000 USD (mesečno)', FALSE);

